    fetch('https://jsonplaceholder.typicode.com/users')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
    })
    .catch(console.log)
  }
  state = {
    contacts: []
  }
  render () {
    return (
        <div className="App">
        <div className="Employees">

          <h1>Employees</h1>









      <Contacts contacts={this.state.contacts} />


      </div>
      </div>
)
}
}


export default App;
